import React from 'react';
import "./Nav.css"
import About from './Pages/About';
import Projects from "./Pages/Projects"
import Contact from "./Pages/Contact"

import { Nav } from './Nav';

const App = () => {
  return (
    <div>
       <Nav />
       <About />
       <Projects />
       <Contact />
    </div>
  );
}

export default App;
